import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

const List = () => {
    let url = `http://dev.api.fliz.com.sa/api/v1/admin/user/list?page=1&perPage=10&role=renter_user&isActive=all`
    const [error, setError] = useState();
    const [data, setData] = useState([]);
    const fetchData = async () => {
        try {
            const list = await axios.get(url,
                {
                    headers: {
                        'Authorization': localStorage.getItem('token'),
                        'Content-Type': 'application/json',
                    }
                }
            );
            const data = list.data.data.findUserDetails;
            console.log(data);
            setData(data);
        } catch (err) {
            setError(err);
        }
    }
    useEffect(() => {
        fetchData();
    }, []);

    return (
        <div>
            <h1>List of Renter Companies</h1>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email ID</th>
                        <th>Phone Number</th>
                        <th>Address</th>
                        <th>Created At</th>
                        <th>Status</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item) => {
                        <tr key={item._id}>
                            <td>{item.name}</td>
                            <td>{item.email}</td>
                            <td>{item.phoneNumber}</td>
                        </tr>
                    })}
                </tbody>
            </table>
        </div>
    );
};

export default List;
